import React from 'react';
import logo from '../icons/dog.svg';
import editIcon from '../icons/edit.svg';
import deleteIcon from '../icons/delete.svg';

function DoggoList (props) {
  return (
    <div className="doggo-list-box">
      <div className="columns">

        <div className="column is-one-fifth">
          <img src={logo} alt="logo" width="112" height="28" />
        </div>

        <div className="column is-three-quarters">
          <p><strong>{props.doggoName}</strong></p>
          <p>Age: {props.doggoAge}</p>
          <p>Doggo id: {props.doggoId}</p>
          <p>Description: {props.doggoDescription}</p>
        </div>

        <div className="icon-box">
          <a><img src={editIcon} alt="edit" width="20" height="20" /></a>
          <a><img src={deleteIcon} alt="delete" width="20" height="20" /></a>
        </div>

      </div>
    </div>
  );
}

export default DoggoList;
